    <div className="content">
      <div>
        <img id="selfie" src="https://avatars.githubusercontent.com/u/45922387?v=4"/>
      </div>
      <div id="home">
        <div> {/*column 1*/}
          <h2 className="tagline">Elliot Buckingham - aspiring Developer</h2>
          <p>Nice to meet you, I'm Elliot, a current BSc Computer Science Student at the University of Bristol.</p>
        </div>
        <div> {/*column 2*/}
          <p>Hi hi this iss my epic homepage ^_^</p>
        </div>
      </div>

    </div>
  )
}
